import React, { Component } from 'react';

const MainHeaderWord = (props) => {
	return props.word.length == 1 ? (
		<div className={style.lower}>{props.word}</div>
	) : (
		<div className={style.upper}>{props.word}</div>
	);
};

export default MainHeaderWord;
